> Entertainment Alaska tribal members get back totem pole taken by actor While standing in front of his tribe's totem pole, Tlingit Tribe member from Klawock, Alaska Jonathan Rowan speaks about the significance of the totem pole to his Tribe at the Honolulu Museum of Arts, Thursday, Oct. 22, 2015, in Honolulu. The totem pole, stolen by actor John Barrymore during a sailing trip to Alaska in 1931, was returned to the Tribe today by the Honolulu Museum of Arts where it was on display since the early 1980s. The totem pole was carved by the ancestors of the Tlingit Tribe. (AP Photo/Marco Garcia) 
